import { React, useState } from "react";
import AddUser from "./Components/Users/AddUser";
import UserList from "./Components/Users/UserList";

function App() {
  const [users, addNewUser] = useState([]);

  return (
    <>
      <AddUser />
      <UserList onAddUser={addNewUser} />
    </>
  );
}

export default App;
